def calcula_media(input_dict):
    output_dict = {}
    for key, value in input_dict.items():
        tamanho = len(value)
        if tamanho % 2 == 1:
            value = value[:-1]  # descarta o último elemento se o tamanho for ímpar
            tamanho -= 1
        pares = [(value[i], value[i+1]) for i in range(0, tamanho, 2)]
        media_pares = [sum(par) / 2 for par in pares]  # calcula a média de cada par de valores
        output_dict[key] = media_pares
    return output_dict


def calcula_media_7(input):
    output = {}
    for key, value in input.items():
        tamanho = len(value)
        pares = [(value[i], value[i+7]) for i in range(0, tamanho-7, 7)]  # cria os pares com passo de 7
        if tamanho >= 7 and tamanho % 7 > 0:
            pares.append((value[-7], value[-1]))  # cria o último par, se houver elementos suficientes
        output[key] = [sum(par)/2 for par in pares]  # calcula a média de cada par e adiciona ao output
    return output





